package com.gdlgxy.internshipcommunity.module.community;import android.os.Bundle;import android.util.Log;import android.view.LayoutInflater;import android.view.View;import android.view.ViewGroup;import android.widget.TextView;import com.gdlgxy.internshipcommunity.base.BaseFragment;import com.gdlgxy.internshipcommunity.databinding.FragmentCommunityBinding;import com.gdlgxy.navannotationmodule.FragmentDestination;import androidx.annotation.NonNull;import androidx.annotation.Nullable;import androidx.lifecycle.Observer;import androidx.lifecycle.ViewModelProvider;@FragmentDestination(pageUrl = "main/module/community",asStarter = false)public class CommunityFragment extends BaseFragment<FragmentCommunityBinding> {    private CommunityViewModel communityViewModel;    @Override    public void onViewCreated(@NonNull View view, @Nullable Bundle savedInstanceState) {        super.onViewCreated(view, savedInstanceState);        communityViewModel =                new ViewModelProvider(this).get(CommunityViewModel.class);        communityViewModel.getText().observe(getViewLifecycleOwner(), new Observer<String>() {            @Override            public void onChanged(String s) {                viewBinding.text.setText(s);            }        });        Log.d("fragment-onViewCreated", "CommunityFragment");    }    @Override    public void onDestroyView() {        super.onDestroyView();        communityViewModel = null;    }    @Override    public String getPageName() {        return null;    }    @Override    public FragmentCommunityBinding inflate_Fragment(LayoutInflater layoutInflater, ViewGroup container, boolean at) {        return FragmentCommunityBinding.inflate(layoutInflater, container, false);    }}